import React from "react";
import { Link } from "react-router-dom";

const Home = ({blog}) => {
  const postBlog = blog.map(post => (

    <div>

      <h2>{post.title}</h2>
      <h2>{post.category}</h2>

    </div>
  ));
  return <div className="landingPage">{postBlog}</div>;
};

export default Home;
